import React from "react";

const MovieList = (props) => {
  return (
    <>
      {props.movies.map((movie, index) => (
        <div key={index} className="column d-flex justify-content-start m-3">
          <img src={movie.Poster} alt="movie"></img>
          <p>{movie.Title}</p>
        </div>
      ))}
    </>
  );
};
export default MovieList;
